import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { activitiesAction } from "../../../redux/actions/actionCreator";
import Cookies from "universal-cookie";
import {
  Background,
  ModalWrapper,
  ModalCotent,
  CloseModal,
} from "../../../styledComponents/Dashboard/Modals/listTransactionsModal";
const ListTransactions = ({ state, setState }) => {
  const dispatch = useDispatch();
  const select = useSelector((e) => {
    return e;
  });
  const cookie = new Cookies();
  let token = { token: cookie.get("login") };

  useEffect(() => {
    dispatch(activitiesAction(token));
  });
  return (
    <div>
      {state.ListTransaction ? (
        <Background>
          <ModalWrapper>
            <ModalCotent>Hello World</ModalCotent>
            <CloseModal
              onClick={() => {
                setState((prevstate) => ({
                  ...prevstate,
                  ListTransaction: false,
                }));
              }}
            >
              &times;
            </CloseModal>
          </ModalWrapper>
        </Background>
      ) : null}
    </div>
  );
};

export default ListTransactions;
